import {  Box,Typography,styled } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'
import '../Details/UserList.css'
import { Actiontypes } from '../Reducer/action'
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import Tooltip, { tooltipClasses } from '@mui/material/Tooltip';

const BootstrapTooltip = styled(({ className, ...props }) => (
  <Tooltip {...props} arrow classes={{ popper: className }} />
))(({ theme }) => ({
  [`& .${tooltipClasses.arrow}`]: {
    color: theme.palette.common.black,
  },
  [`& .${tooltipClasses.tooltip}`]: {
    backgroundColor: theme.palette.common.black,
  },
}));

export const UserList = () => {
  const contacts = useSelector((state) => state);
  const dispatch = useDispatch()

  const deleteAccount = (id) => {
    dispatch({ type: Actiontypes.DELETE_CONTACT, payload: id })
  }



  return (
    <div >
    <Box sx={{ml:35 }}>

            <Link to="/">
              <button
                style={{
                  backgroundColor: '#CF4B28',
                  color: 'white',
                  border: '1px solid #CF4B28',
                  borderRadius: '6px', 
                  padding: '5px',
                  marginTop:'30px'
                }}>
                Add user
              </button>
            </Link>

            <div >
              <table style={{ marginTop: 10,width:'70%' }} >
                <thead>
                  <tr style={{ backgroundColor: '#CF4B28', color: 'white' }}>
                    <th>id</th>
                    <th>Account Name</th>
                    <th>Account Code</th>
                    <th>Account Type</th>
                    <th>Description</th>
                    <th>Actions</th>

                  </tr>
                </thead>
                <tbody >


                  {contacts.length > 0 ? (
                    contacts.map((contact, id) => (
                      <tr key={id}>
                        <td>{id + 1}</td>
                        <td>{contact.name}</td>
                        <td>{contact.code}</td>
                        <td>{contact.type}</td>
                        <td>{contact.description}</td>

                        <td>
                          <Link to={`/edit/${contact.id}`}>
                             <BootstrapTooltip title="Edit" placement="top-start" arrow>
                            <button
                              style={{

                               border:'none'
                              }}>
                            <Typography sx={{
                              color:'chocolate'
                            }}>

                              <a></a> <EditIcon/>

                            </Typography>
                            </button>
                            </BootstrapTooltip>
                          </Link>

                          <button
                            type="button"
                            style={{border: 'none'}}
                            onClick={() => deleteAccount(contact.id)}>

                            <Typography sx={{
                              color:'chocolate'
                            }}>

                            <DeleteIcon/> 

                            </Typography>
                          </button>
                        </td>
                      </tr>
                    ))
                  ) : (
                    <tr>
                      <th>No contacts found</th>
                    </tr>
                  )}
                </tbody>

              </table>
            </div>


    </Box>

    </div>
  )
}
